import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import NavigationBar from './components/NavigationBar'; // Assuming the path to your navbar component
import HomePage from './pages/HomePage'; // Path to HomePage component
import ProjectPage from './pages/ProjectPage'; // Path to ProjectPage component
import AboutUsPage from './pages/AboutUsPage'; // Path to AboutUsPage component
import ContactUsPage from './pages/ContactUsPage'; // Path to ContactUsPage component

const App = () => {
  return (
    <Router>
      {/* Navigation Bar */}
      <NavigationBar />

      {/* Define the routes for each page */}
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/projects" component={ProjectPage} />
        <Route path="/about-us" component={AboutUsPage} />
        <Route path="/contact-us" component={ContactUsPage} />
      </Switch>
    </Router>
  );
}

export default App;
